        {
            var shaFactory = new NativeShaFactory();
            var sha = shaFactory.GetShaInstance(new HashFunction(mode, digestSize));
            var messageBs = new BitString(message);
            var stopWatch = new Stopwatch();

            stopWatch.Start();
